import React from "react";
import { motion } from "framer-motion";

const projects = [
  {
    id: 1,
    title: "Minimalist Studio Apartment",
    description: "Clean lines and modern aesthetics define this compact urban living space",
    image: "https://images.unsplash.com/photo-1586023492125-27b2c045efd7",
    span: "col-span-2 row-span-2"
  },
  {
    id: 2,
    title: "Rustic Mountain Cabin",
    description: "Cozy wilderness retreat with natural materials and panoramic views",
    image: "https://images.unsplash.com/photo-1600585154526-990dced4db0d",
    span: "col-span-1 row-span-1"
  },
  {
    id: 3,
    title: "Contemporary Beach House",
    description: "Oceanfront luxury with floor-to-ceiling windows and open concept design",
    image: "https://images.unsplash.com/photo-1600607687644-a7e0722b6549",
    span: "col-span-1 row-span-1"
  },
  {
    id: 4,
    title: "Industrial Loft Space",
    description: "Raw materials meet refined design in this urban conversion project",
    image: "https://images.unsplash.com/photo-1600566752355-35792bedcfea",
    span: "col-span-1 row-span-2"
  },
  {
    id: 5,
    title: "Scandinavian Kitchen",
    description: "Functional elegance with light wood and clean aesthetics",
    image: "https://images.unsplash.com/photo-1600585154340-be6161a56a0c",
    span: "col-span-2 row-span-1"
  },
  {
    id: 6,
    title: "Modern Home Office",
    description: "Sleek workspace designed for productivity and comfort",
    image: "https://images.unsplash.com/photo-1585412727339-54e4bae3bbf9",
    span: "col-span-1 row-span-1"
  },
  {
    id: 7,
    title: "Luxury Penthouse",
    description: "Sophisticated urban living with panoramic city views",
    image: "https://images.unsplash.com/photo-1600210492493-0946911123ea",
    span: "col-span-2 row-span-2"
  },
  {
    id: 8,
    title: "Zen Garden Bathroom",
    description: "Tranquil spa-like retreat with natural elements",
    image: "https://images.unsplash.com/photo-1604014237800-1c9102c219da",
    span: "col-span-1 row-span-1"
  },
  {
    id: 9,
    title: "Art Deco Living Room",
    description: "Glamorous space with geometric patterns and luxe finishes",
    image: "https://images.unsplash.com/photo-1600121848594-d8644e57abab",
    span: "col-span-2 row-span-1"
  }
];

const ProjectCard = ({ project }) => {
  return (
    <motion.div
      whileHover={{ scale: 1.02 }}
      transition={{ duration: 0.3 }}
      className={`relative overflow-hidden rounded-2xl ${project.span} bg-white shadow-xl`}
    >
      <div className="group relative h-full w-full overflow-hidden">
        <img
          src={project.image}
          alt={project.title}
          className="h-full w-full object-cover transition-transform duration-300 group-hover:scale-110"
          onError={(e) => {
            e.target.src = "https://images.unsplash.com/photo-1600585154526-990dced4db0d";
          }}
        />
        <div className="absolute inset-0 bg-gradient-to-t from-black/70 to-transparent">
          <div className="absolute bottom-0 p-6">
            <h3 className="text-2xl font-bold text-white">{project.title}</h3>
            <p className="mt-2 text-sm text-gray-200">{project.description}</p>
          </div>
        </div>
      </div>
    </motion.div>
  );
};

const Interior = () => {
  return (
    <div className="container mx-auto p-8">
      <h1 className="mb-12 text-4xl font-bold text-gray-800">Featured Interior Projects</h1>
      <div className="grid h-[1200px] grid-cols-1 gap-4 md:grid-cols-3 lg:grid-cols-4">
        {projects.map((project) => (
          <ProjectCard key={project.id} project={project} />
        ))}
      </div>
    </div>
  );
};

export default Interior;
